// import external modules
import React, { Fragment } from "react";
import { Row, Col, Card, CardHeader, CardTitle, CardBody } from "reactstrap";
import ChartistGraph from "react-chartist";
import ChartistLib from "chartist";
import "chartist/dist/chartist.min.css";

// import internal(own) modules
import { ChartistData } from "./chartistData";
import "../../../assets/scss/views/charts/chartist.scss";

const Chartist = props => (
   <Fragment>
      <Row>
         <Col sm="12" className="content">
            <div className="content-header text-dark">List</div>
            <p className="content-sub-header">
               List groups are a flexible and powerful component for displaying not only simple lists of elements, but
               complex ones with custom content.
            </p>
         </Col>
      </Row>
      <Row>
         <Col sm="12">
            <Card>
               <CardHeader>
                  <CardTitle>LINE WITH AREA CHART</CardTitle>
               </CardHeader>
               <CardBody>
                  <ChartistGraph
                     data={ChartistData.LineArea1Data}
                     type="Line"
                     options={{
                        height: "400px",
                        low: 0,
                        showArea: true,
                        fullWidth: true,
                        onlyInteger: true,
                        axisY: {
                           low: 0,
                           scaleMinSpace: 50
                        },
                        axisX: {
                           showGrid: false
                        }
                     }}
                  />
               </CardBody>
            </Card>
         </Col>

         <Col sm="12">
            <Card>
               <CardHeader>
                  <CardTitle>LINE WITH AREA CHART</CardTitle>
               </CardHeader>
               <CardBody>
                  <ChartistGraph
                     data={ChartistData.LineArea2Data}
                     type="Line"
                     options={{
                        height: "400px",
                        showArea: true,
                        fullWidth: true,
                        lineSmooth: ChartistLib.Interpolation.none(),
                        axisX: {
                           showGrid: false
                        },
                        axisY: {
                           low: 0,
                           scaleMinSpace: 50
                        },
                        chartPadding: {
                           top: 0,
                           right: 25,
                           bottom: 0,
                           left: 0
                        }
                     }}
                  />
               </CardBody>
            </Card>
         </Col>

         <Col sm="12">
            <Card>
               <CardHeader>
                  <CardTitle>LINE WITH AREA CHART</CardTitle>
               </CardHeader>
               <CardBody>
                  <ChartistGraph
                     data={ChartistData.LineArea3Data}
                     type="Line"
                     options={{
                        height: "400px",
                        low: 0,
                        showArea: true,
                        fullWidth: true,
                        onlyInteger: true,
                        axisY: {
                           low: 0,
                           scaleMinSpace: 50
                        }
                     }}
                  />
               </CardBody>
            </Card>
         </Col>

         <Col sm="12">
            <Card>
               <CardHeader>
                  <CardTitle>LINE WITH AREA CHART</CardTitle>
               </CardHeader>
               <CardBody>
                  <ChartistGraph
                     data={ChartistData.LineArea4Data}
                     type="Line"
                     options={{
                        // low: 650,
                        height: "400px",
                        low: 0,
                        showArea: true,
                        fullWidth: true
                     }}
                  />
               </CardBody>
            </Card>
         </Col>

         <Col sm="12">
            <Card>
               <CardHeader>
                  <CardTitle>LINE CHART</CardTitle>
               </CardHeader>
               <CardBody>
                  <ChartistGraph
                     data={ChartistData.Line1Data}
                     type="Line"
                     options={{
                        height: "400px",
                        axisX: {
                           showGrid: false
                        },
                        axisY: {
                           low: 0,
                           scaleMinSpace: 50
                        },
                        fullWidth: true,
                        chartPadding: {
                           top: 0,
                           right: 25,
                           bottom: 0,
                           left: 0
                        }
                     }}
                  />
               </CardBody>
            </Card>
         </Col>

         <Col sm="12">
            <Card>
               <CardHeader>
                  <CardTitle>LINE CHART</CardTitle>
               </CardHeader>
               <CardBody>
                  <ChartistGraph
                     data={ChartistData.Line2Data}
                     type="Line"
                     options={{
                        height: "400px",
                        axisX: {
                           showGrid: false
                        },
                        axisY: {
                           low: 0,
                           scaleMinSpace: 50
                        },
                        fullWidth: true,
                        chartPadding: {
                           top: 0,
                           right: 25,
                           bottom: 0,
                           left: 0
                        }
                     }}
                  />
               </CardBody>
            </Card>
         </Col>

         <Col sm="12">
            <Card>
               <CardHeader>
                  <CardTitle>LINE CHART</CardTitle>
               </CardHeader>
               <CardBody>
                  <ChartistGraph
                     data={ChartistData.Line3Data}
                     type="Line"
                     options={{
                        height: "400px",
                        axisX: { showGrid: false },
                        axisY: {
                           scaleMinSpace: 30
                        },
                        fullWidth: true,
                        chartPadding: {
                           top: 0,
                           right: 50,
                           bottom: 0,
                           left: 0
                        }
                     }}
                  />
               </CardBody>
            </Card>
         </Col>

         <Col sm="12">
            <Card>
               <CardHeader>
                  <CardTitle>SCATTER LINE CHART</CardTitle>
               </CardHeader>
               <CardBody>
                  <ChartistGraph
                     data={ChartistData.ScatterLineData}
                     type="Line"
                     options={{
                        height: "400px",
                        axisX: { showGrid: false },
                        axisY: {
                           scaleMinSpace: 30
                        },
                        fullWidth: true
                     }}
                  />
               </CardBody>
            </Card>
         </Col>

